import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  const styles = {
    nav: {
      backgroundColor: '#007BFF',
      color: 'white',
      padding: '10px 20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
    },
    link: {
      color: 'white',
      textDecoration: 'none',
      margin: '0 10px',
      fontWeight: 'bold',
    },
  };

  return (
    <nav style={styles.nav}>
      <div>
        <Link to="/" style={styles.link}>Landing Page</Link>
        <Link to="/events" style={styles.link}>View All Events</Link>
      </div>
    </nav>
  );
}

export default Navbar;
